import React, { Component } from 'react';
import { Bills } from '../../Fetches/Queries';

class Reports extends Component {
  constructor() {
    super();
    this.state = {
      bill: ''
    };
    this.fetchBill = this.fetchBill.bind();
  }
  fetchBill = async () => {
    let a = await Bills();
    await this.setState({ bill: a });
  };
  componentDidMount() {
    this.fetchBill();
  }
  render() {
    return (
      <div>
        {this.state.bill && console.log(Object.assign(this.state.bill))}HI
      </div>
    );
  }
}

export default Reports;
